        color: $color-5;
      }

      .slide__small-title {
        color: $color-5;
        font-size: 22px;
        font-style: normal;
        font-weight: 700;
        line-height: normal;
      }

      .slide__list {
        margin-top: 16px;
        display: flex;
        gap: 9px;
        flex-direction: column;

        .slide__list-item {
          position: relative;
          margin-left: 14px;
          @include text-common-styles;
          line-height: normal;
          color: $color-5;

          &::before {
            content: "";
            background-image: image-set(url("images/slide__green-dot.svg"));
            background-repeat: no-repeat;
            background-position: center;
            width: 7px;
            height: 7px;
            position: absolute;
            left: -17px;
            top: 7px;
          }
        }
      }

